CREATE TABLE colleges(
   unitid                                   INTEGER  NOT NULL PRIMARY KEY 
  ,institution_name                         VARCHAR(110) NOT NULL
  ,year                                     INTEGER  NOT NULL
  ,HD2018Institution_name_alias             VARCHAR(680)
  ,HD2018Street_address_or_post_office_box  VARCHAR(81)
  ,HD2018City_location_of_institution       VARCHAR(24) NOT NULL
  ,HD2018State_abbreviation                 VARCHAR(30) NOT NULL
  ,HD2018ZIP_code                           VARCHAR(10) NOT NULL
);
